import Action from "../Actions";

let initial_state = {
    'auth_token': null
}

const auth_reducer = (state = initial_state, action) => {
    switch (action.type) {
        case Action.LOGIN: {
            let stateCopy = structuredClone(state)
            stateCopy.auth_token = action.auth_token
            console.log(stateCopy)
            return stateCopy
        }
    }
}

export default auth_reducer;
